import "./App.css";
import Homepage from "./HomepageIndex.js";
import { createBrowserRouter, Router, RouterProvider } from "react-router-dom";
function App() {
    const routes = createBrowserRouter([
        {
            path: "/",
            element: <Homepage />,
        },
    ]);
    return (
        <div className="App">
            <RouterProvider router={routes} />
        </div>
    );
}

export default App;
